import { Sky } from '@react-three/drei'

export default function Firmament(props) {
  return (
    <Sky
      turbidity={10}
      distance={3} // Camera distance (default=450000)
      sunPosition={[3000, 0, 9000]} // Sun position normal (defaults to inclination and azimuth if not set)
      inclination={0.7} // Sun elevation angle from 0 to 1 (default=0)
      azimuth={0.8} // Sun rotation around the Y axis from 0 to 1 (default=0.25)
      {...props} // All three/examples/jsm/objects/Sky props are valid
    />  )
}
